// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IERC777TokensRecipient {
    function tokensReceived(
        address from,
        address to,
        uint256 amount,
        bytes calldata data
    ) external returns (bytes4 retval);
}

TokenBank.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/*
编写一个 TokenBank 合约，可以将自己的 Token 存入到 TokenBank， 和从 TokenBank 取出。

TokenBank 有两个方法：

deposit() : 需要记录每个地址的存入数量；
withdraw（）: 用户可以提取自己的之前存入的 token。
在回答框内输入你的代码或者 github 链接。

*/

import "./BaseERC20.sol";

contract TokenBank {
    // 可以处理多种token
    // token的地址、 账户的地址、 账户对应的token余额
    mapping(address => mapping(address => uint256)) public userTokenBalances;

    constructor() {}

    /** 指定代币地址与金额，向银行存入该代币.
     */
    function deposit(address token, uint256 _value) public {
        BaseERC20 erc20 = BaseERC20(token);
        erc20.transferFrom(msg.sender, address(this), _value);
        userTokenBalances[token][msg.sender] += _value;
    }

    /** 用户从银行提取自己的token
     */
    function withdraw(address token, uint256 _value) public {
        uint256 balance = userTokenBalances[token][msg.sender];
        require(_value <= balance, "Bank: withdraw amount exceeds balance");

        BaseERC20 erc20 = BaseERC20(token);

        userTokenBalances[token][msg.sender] -= _value;
        erc20.transfer(address(msg.sender), _value);
    }
}

BaseERC20.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract BaseERC20 {
    string public name;
    string public symbol;
    uint8 public immutable decimals;

    uint256 public immutable totalSupply;

    mapping(address => uint256) balances;

    mapping(address => mapping(address => uint256)) allowances;

    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(
        address indexed owner,
        address indexed spender,
        uint256 value
    );

    constructor() {
        // write your code here
        // set name,symbol,decimals,totalSupply
        name = "BaseERC20";
        symbol = "BERC20";
        decimals = 18;
        totalSupply = 100000000 * (1e18);

        balances[msg.sender] = totalSupply;
    }

    function balanceOf(address _owner) public view returns (uint256 balance) {
        // write your code here
        return balances[_owner];
    }

    function transfer(
        address _to,
        uint256 _value
    ) public returns (bool success) {
        // write your code here

        require(
            balances[msg.sender] >= _value,
            "ERC20: transfer amount exceeds balance"
        );

        balances[msg.sender] -= _value;
        balances[_to] += _value;

        emit Transfer(msg.sender, _to, _value);
        return true;
    }

    function transferFrom(
        address _from,
        address _to,
        uint256 _value
    ) public returns (bool success) {
        // write your code here
        require(
            balances[_from] >= _value,
            "ERC20: transfer amount exceeds balance"
        );
        require(
            allowances[_from][msg.sender] >= _value,
            "ERC20: transfer amount exceeds allowance"
        );

        balances[_from] -= _value;
        balances[_to] += _value;

        allowances[_from][msg.sender] -= _value;

        emit Transfer(_from, _to, _value);
        return true;
    }

    function approve(
        address _spender,
        uint256 _value
    ) public returns (bool success) {
        // write your code here
        // mapping(address => mapping(address => uint256)) allowances;
        mapping(address => uint256) storage aa = allowances[msg.sender];
        aa[_spender] = _value;

        emit Approval(msg.sender, _spender, _value);
        return true;
    }

    function allowance(
        address _owner,
        address _spender
    ) public view returns (uint256 remaining) {
        // write your code here
        return allowances[_owner][_spender];
    }
}

